import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom'
import { config } from '../api/config';

const Edit = () => {

    const[useredit , setUseredit] = useState({
        name : '',
        email : '',
        username :'',
        city : '',
        mobile :''
    })
    const {id} =useParams();
    useEffect(()=>{
        const edituserid = async()=>{
            const reqdata = await fetch(config.REGISTER_USER/{id});
            const res = await reqdata.json();
            setUseredit(await res);
        }
    })
  return (
    <div>
        <div className='container'>
       <h1>Users Edit</h1>
       <hr></hr>
<label htmlFor="name" className="label">  Name : </label>
        <input type="text"  className="form-control " value={useredit.name}></input>

        <label htmlFor="name" className="label">  Email : </label>
        <input type="text"  className="form-control" value={useredit.email}></input>

        <label htmlFor="name" className="label">  User Name : </label>
        <input type="text"  className="form-control"  value={useredit.username}></input>

        <label htmlFor="name" className="label">  City : </label>
        <input type="text"  className="form-control" value={useredit.city} ></input>

        <label htmlFor="name" className="label">  Phone no. : </label>
        <input type="text"  className="form-control" value={useredit.mobile} ></input><br></br>
        <button className='btn btn-dark btn-lg'>Update</button>
        </div>
    </div>
  )
}

export default Edit
